import React, { Component, Fragment } from 'react';
import { Container, Row, Col } from 'react-bootstrap';

class Department extends Component {
    render() {
        return (
            <Fragment>
                <Container>
                    <Row>
                        <Col></Col>
                    </Row>
                </Container>
            </Fragment>

        );
    }
}

export default Department;
